import React from "react";
import Header from "../header/Header";
import "./ShopDetail.css";
import { Avatar } from "@material-ui/core";

function ShopDetail() {
  return (
    <>
      <div className='container'>
        <Header />
        <div className='detail_item_main'>
          <div className='detail_item'>
            <img
              src='https://specials-images.forbesimg.com/imageserve/5d3703e2f1176b00089761a6/960x0.jpg?cropX1=836&cropX2=5396&cropY1=799&cropY2=3364'
              alt='Car'
            />
            <div className='detail_item_info'>
              <h1>item name</h1>
              <h3>$50,000</h3>
              <h5>Downtown, Calgary</h5>
              <button>Like</button>
              <div className='detail_item_info_msg'>
                <textarea name='' id='' cols='20' rows='5'></textarea>
              </div>
            </div>
          </div>
          <div className='detail_item_description'>
            <h5>Description</h5>
            <p>This is a car</p>
          </div>

          <div className='detail_info_1'>
            <Avatar Avatar className='header__main__right__avatar'>
              J
            </Avatar>
            <h5>name</h5> {/* seller name */}
            <h5>Number of deal: 1000</h5> {/* counting number */}
          </div>
          <div className='detail_info_2'>
            <h5>4.5/5</h5> {/* rating */}
            <h5>Going to see seller's product</h5> {/* link */}
          </div>
        </div>
      </div>
    </>
  );
}

export default ShopDetail;
